// XReport.js (Web version of XReportGenerator)
import React, { useEffect, useState } from 'react';
import axios from 'axios';

const XReport = () => {
  const [startHour, setStartHour] = useState(0);
  const [endHour, setEndHour] = useState(23);
  const [reportData, setReportData] = useState([]);

  const fetchReport = async () => {
    if (startHour > endHour) {
      alert('Start hour cannot be after end hour.');
      return;
    }
    try {
      const res = await axios.get('/api/x-report', {
        params: { startHour, endHour }
      });
      setReportData(res.data);
    } catch (err) {
      alert('Failed to fetch report.');
    }
  };

  useEffect(() => {
    fetchReport();
  }, []);

  return (
    <div style={{ padding: 20 }}>
      <h2>ðŸ“Š X-Report - Hourly Sales Breakdown</h2>

      <label>Start Hour:</label>
      <select value={startHour} onChange={(e) => setStartHour(Number(e.target.value))}>
        {[...Array(24).keys()].map((hr) => (
          <option key={hr} value={hr}>{hr}:00</option>
        ))}
      </select>

      <label style={{ marginLeft: 20 }}>End Hour:</label>
      <select value={endHour} onChange={(e) => setEndHour(Number(e.target.value))}>
        {[...Array(24).keys()].map((hr) => (
          <option key={hr} value={hr}>{hr}:00</option>
        ))}
      </select>

      <button onClick={fetchReport} style={{ marginLeft: 20 }}>Generate</button>

      <table border="1" cellPadding="5" style={{ marginTop: 20, width: '100%' }}>
        <thead>
          <tr>
            <th>Hour</th>
            <th>Transactions</th>
            <th>Sales Revenue ($)</th>
            <th>Total Sales ($)</th>
            <th>Returns ($)</th>
            <th>Drinks Sold</th>
            <th>Voids ($)</th>
            <th>Discards ($)</th>
            <th>Payment Methods</th>
          </tr>
        </thead>
        <tbody>
          {reportData.length === 0 ? (
            <tr><td colSpan="9">No data</td></tr>
          ) : (
            reportData.map((row, idx) => (
              <tr key={idx}>
                <td>{row.hour}</td>
                <td>{row.total_transactions}</td>
                <td>{parseFloat(row.sales_revenue).toFixed(2)}</td>
                <td>{parseFloat(row.total_sales).toFixed(2)}</td>
                <td>{parseFloat(row.total_returns).toFixed(2)}</td>
                <td>{row.drink_sales}</td>
                <td>{parseFloat(row.voids).toFixed(2)}</td>
                <td>{parseFloat(row.discards).toFixed(2)}</td>
                <td>{row.payment_methods}</td>
              </tr>
            ))
          )}
        </tbody>
      </table>
    </div>
  );
};

export default XReport;
